import * as React from "react";
import { Routes, Route, Link } from "react-router-dom";
import './App.css';
import LandingPage from './components/LandingPage/LandingPage';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Routes>
          <Route path="/" element={<LandingPage />} />

        </Routes>




      </header>
    </div>
  );
}

export default App;
